pins.description:
Byens Ø er en kultur- og oplevelses ø i Odense Havn, hvor der er mulighed for at  skate, dyrke parkour, crossfit/calisthenic, løbe på løbehjul, rulleskøjter, streetfodbold.
<h1></h1>
Læs mere om skatefaciliteterne <a target="_blank"  href="http://skateparks.dk/fyn/odense-havn/">her</a>.

&nbsp;

&nbsp;

Udendørs skateareal på en fritidsklub i Skanderborg med diverse obstacles.

Læs mere <a target="_blank"  href="http://skateparks.dk/midtjylland/skanderborg-skatepark/">her</a>.

&nbsp;

&nbsp;

Udendørs streetareal med skatefaciliteter samt plads til basket- og fodbold. Om vinteren bliver skateparken flyttet, og forvandles i stedet til en skøjtebane.

Læs mere om skatefaciliteterne <a target="_blank"  href="http://skateparks.dk/sjaelland/holbaek-skatepark/">her</a>.

&nbsp;
